import React from "react";
import "./daily_info.scss";

const dailyInfo = () => {
  return (
    <div className="sidebar__info">
      <div className="sidebar__info__item">
        <p>29 August</p>
        <p>11:44:55</p>
      </div>
      <div className="sidebar__info__item">25c</div>
    </div>
  );
};
export default dailyInfo;
